-- Funo para Alternar GUI Fluent
--------------------------------------------------------------------
local function ToggleFluent()
    if Window and Window.Root then
        Window.Root.Visible = not Window.Root.Visible
    end
end

--------------------------------------------------------------------
-- SISTEMA DE TAP VS ARRASTAR (MOBILE + PC)
--------------------------------------------------------------------
local dragging = false
local dragStart = nil
local startPos = nil
local moved = false
local DRAG_THRESHOLD = 12  -- Mnimo de pixels para considerar arrastar

ImageButton.InputBegan:Connect(function(input)
    if input.UserInputType == Enum.UserInputType.Touch or 
       input.UserInputType == Enum.UserInputType.MouseButton1 then

        dragging = true
        moved = false
        dragStart = UserInputService:GetMouseLocation()
        startPos = ImageButton.Position
    end
end)

ImageButton.InputChanged:Connect(function(input)
    if input.UserInputType == Enum.UserInputType.MouseMovement or 
       input.UserInputType == Enum.UserInputType.Touch then
        if dragging then
            local currentPos = UserInputService:GetMouseLocation()
            local delta = currentPos - dragStart

            if delta.Magnitude > DRAG_THRESHOLD then
                moved = true
            end

            if moved then
                ImageButton.Position = UDim2.new(
                    startPos.X.Scale, startPos.X.Offset + delta.X,
                    startPos.Y.Scale, startPos.Y.Offset + delta.Y
                )
            end
        end
    end
end)

ImageButton.InputEnded:Connect(function(input)
    if input.UserInputType == Enum.UserInputType.Touch or 
       input.UserInputType == Enum.UserInputType.MouseButton1 then

        dragging = false

        -- Se no arrastou   clique
        if not moved then
            ToggleFluent()
        end
    end
end)

--------------------------------------------------------------------
-- Tecla P (PC) para alternar GUI
--------------------------------------------------------------------
UserInputService.InputBegan:Connect(function(input, gameProcessed)
    if not gameProcessed and input.KeyCode == Enum.KeyCode.P then
        ToggleFluent()
    end
end)


